    public class LicenceCheck
    {
        private string LicenceCreateDate = "01-Jan-2026";
        private string Author = "M.A. Monaem Khan";
        private string ContactNo = "+8801303271849";
        private string Email = "khanmonaem07@gmail.com";
        private string AuthorImage = "<img src='data:image/jpeg;base64,'\r\n            width=\"200px\" height=\"250px\"/>";

        public bool isLicenceExpire()
        {
            if (Convert.ToDateTime(LicenceCreateDate) <= DateTime.UtcNow)
            {
                return true;
            }
            else
            {
                return false;
            }
        }

        public int remainLicenceDate()
        {
            int remainDays = 0;
            int x = (Convert.ToDateTime(LicenceCreateDate) - DateTime.UtcNow).Days;
            remainDays = x;
            return remainDays;
        }

        public AutherDetails getAuthorDetails()
        {
